import keyword
def dec1(text):
    """ برای پیدا کردن کلمه کلیدی توی متنمون """
    keyword1 = [ ]#یه لیست خالی درست میکنیم 
    for word in keyword.kwlist:
        if word in text:
            keyword1.append(word)#هر کلمه کلیدی که توی منن باشه به لیست foundkeyword منتقل میشه
    return keyword1
    

#مطمئن نیستم که باید متن رو از کابرد گرفت یا از اول تو یه متغیر قرار داد
text= "......blockchaintechnologydistributedledgerconsensusalgorithmsproofOfWorkproofOfStakeByzantineFaultTolerancepeer-to-peerP2PnetworkscryptographyhashfunctionsasymmetricencryptionpublickeyinfrastructurePKIdigitalcertificatesdigital signaturesmartcontractsdecentralizedapplicationsDAppsEthereumplatformSolidityprogramminglanguageWeb3technologyNFTsnon-fungibletokensDeFidecentralizedfinancedecentralizedexchangesDEXsstablecoinscryptocurrencyminingstakingyieldfarmingliquiditypoolsoraclesDAOsdecentralizedautonomousorganizati..."
print(dec1(text)) 
